import React from 'react';
import '../App.css';
import aliKuva from '../Kiasma.png';



const Who = () => {
   return ( 
      <div> 

         <img className='Port-img' src={aliKuva}/> 
         <h2 className= 'centered'>Who is she?</h2> 
         <p className= 'Port-basic'> Hi! I am Aliisa Palm
         or briefly Ali. I'm a fourth-year student
         in Tampere university with a background of Electrical engineering and 
         a growing passion of user centered tecnhonogy design.
         I am interested of human behaviour, society and history of popular culture 
         - a few themes to mention. 
         My way of living is to set goals and take challenges (not only the serious ones) 
         and righ now I am seeking a job to get new angle on developing and challenging myself. </p>
         <p className= 'Port-copies'>Picture: Jari Rauhala</p>
         </div>
         )
}

export default Who
